export default function PokeInfo() {
  return (
    <div>
      <h1>Charmander</h1>
      <img
        src="https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/shiny/4.png"
        alt=""
      />
      <div className="abilities">
        <div className="group">
          <h2>blaze</h2>
              </div>
              
      </div>
    </div>
  );
}
